import logo from "./logo.svg";
import "./App.css";

function App() {
  return <Form />;
  return <Header />;
}

function Form() {
  return (
    <div>
      <span>My Todo List</span>
      <span>React</span>
    </div>
  );
}
function Header() {
  return (
    <div>
      제목 <input type="text" />
      내용 <input type="text" />
      <input type="submit" />
    </div>
  );
}

export default App;
